INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('COR', 'STOCK', 'Cencora, Inc.', 'NYQ', 'Healthcare', 'Medical Distribution', 'A Cencora, Inc. É uma empresa global de serviços de fornecimento e distribuição de produtos farmacêuticos. A empresa ajuda os prestadores de cuidados de saúde e os fabricantes farmacêuticos e de biotecnologia a melhorar o acesso dos pacientes aos produtos e a melhorar o atendimento aos pacientes. A empresa opera através de dois segmentos: U.S. Healthcare Solutions e International Healthcare Solutions. O segmento de Soluções de Saúde dos EUA distribui uma oferta abrangente de marca, marca especializada e medicamentos genéricos, produtos de saúde de balcão, suprimentos e equipamentos de saúde em casa e serviços relacionados a uma variedade de prestadores de cuidados de saúde, incluindo hospitais de cuidados agudos e sistemas de saúde, farmácias de varejo independentes e em cadeia, farmácias de longo prazo e locais alternativos e outros clientes. O segmento International Healthcare Solutions é composto por empresas que se concentram em operações internacionais de atacado e serviços relaci', 'Conshohocken, PA, United States', 51000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALLR', 'STOCK', 'Allarity Therapeutics, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Allarity Therapeutics, Inc. is a clinical-stage biopharmaceutical company dedicated to developing personalized cancer treatments. It is focused on development of stenoparib, a PARP/tankyrase inhibitor for advanced ovarian cancer patients, using its DRP technology to develop a companion diagnostic that can be used to select those patients expected to derive clinical benefit from stenoparib. Its therapeutic candidate, stenoparib, is a dual inhibitor of the key DNA damage repair enzyme PARP, as well as Tankyrases, critical enzymes involved in the WNT signaling pathway commonly activated in many cancers. Inhibition of key DNA damage repair enzymes, such as PARP, has clinically demonstrated to be therapeutically beneficial in the treatment of cancers (ovarian cancers). The DRP method builds on the comparison of sensitive vs. resistant human cancer cell lines, including transcriptomic information from cell lines, combined with clinical tumor biology filters and prior clinical trial outcomes.', 'Boston, MA, United States', 6);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ADTN', 'STOCK', 'ADTRAN Holdings, Inc.', 'NMS', 'Technology', 'Communication Equipment', 'ADTRAN Holdings, Inc. is a provider of open, disaggregated networking and communications solutions that enable voice, data, video and Internet communications across any network infrastructure. Its segments include Network Solutions, which offers hardware and software products, and Services & Support, which includes a portfolio of network design and implementation services, support services and cloud-hosted SaaS applications. The segments span across Subscriber Solutions, Access & Aggregation Solutions, and Optical Networking Solutions. Its Subscriber Solutions portfolio is used by service providers to terminate their access services infrastructure at the customer''s premises. The Access & Aggregation Solutions are solutions that are used by communications service providers to connect subscribers. Its Optical Networking Solutions are used by communications service providers, Internet content providers and large enterprises to securely interconnect metro and regional networks over fiber.', 'Huntsville, AL, United States', 3091);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BXSL', 'STOCK', 'Blackstone Secured Lending Fund', 'NYQ', 'Financial Services', 'Asset Management', 'Blackstone Secured Lending Fund is an externally managed, non-diversified, closed-end management investment company. The Companys investment objectives are to generate current income and, to a lesser extent, long-term capital appreciation. It invests at least 80% of its total assets in secured debt investments. The Company seeks to achieve its investment objectives primarily through originated loans and other securities, including syndicated loans, of private U.S. companies, typically in the form of first lien senior secured and unitranche loans (including first out/last out loans), and to a lesser extent, second lien, third lien, unsecured and subordinated loans and other debt and equity securities. It invests across various sectors, which include aerospace and defense, air freight and logistics, building products, commercial services and supplies, healthcare providers and services and others. The Company is externally managed by Blackstone Credit BDC Advisors LLC.', 'New York, NY, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BR', 'STOCK', 'Broadridge Financial Solutions, Inc.', 'NYQ', 'Technology', 'Information Technology Services', 'Broadridge Financial Solutions, Inc. É uma empresa de tecnologia financeira. Ele fornece comunicações com investidores e soluções baseadas em tecnologia para bancos, corretores, gerentes de ativos e patrimônio, investidores e outros. Seu segmento de Soluções de Comunicação com Investidores (ICS) fornece Soluções Regulatórias, Soluções de Fundo Orientadas a Dados, Soluções de Emissor Corporativo e Soluções de Comunicação com o Cliente. O negócio de ICS envolve o processamento e distribuição de materiais proxy para investidores em títulos de capital e fundos mútuos, e a facilitação do processamento de votos relacionados. Seu segmento de Tecnologia e Operações Globais (GTO) fornece soluções que automatizam o ciclo de vida de transações frente a verso de ações, fundos mútuos, câmbio e derivativos negociados em bolsa, desde a captura e execução de pedidos até a confirmação de negociação, margem, reconciliações e outros. Ela também opera uma plataforma de processamento de transações dos Serv', 'Lake Success, NY, United States', 15000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AHH', 'STOCK', 'Armada Hoffler Properties, Inc.', 'NYQ', 'Real Estate', 'REIT - Diversified', 'Armada Hoffler Properties, Inc. is a vertically integrated, self-managed real estate investment trust (REIT). The Company is engaged in developing, building, acquiring, and managing office, retail and multifamily properties located primarily in the Mid-Atlantic and Southeastern United States. The Company operates through five segments: office real estate, retail real estate, multifamily real estate, general contracting & real estate services, and real estate financing. The Company''s general contracting, and real estate services business develops and builds properties for its own account and provides construction and development services to both related and third parties. The real estate financing segment includes the Company''s mezzanine loans and preferred equity investments on development projects. The Company also provides general construction and development services to third-party clients, in addition to developing and building properties to be placed in their stabilized portfoli', 'Virginia Beach, VA, United States', 148);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DOV', 'STOCK', 'Dover Corporation', 'NYQ', 'Industrials', 'Specialty Industrial Machinery', 'A Dover Corporation é um fabricante global diversificado e fornecedor de soluções. Seu segmento de produtos de engenharia fornece uma gama de equipamentos, componentes, software, soluções e serviços para o pós-venda de veículos, aeroespacial e defesa, entre outros. Seu segmento de Energia Limpa e Abastecimento fornece componentes, equipamentos e soluções e serviços de software. Também projeta, fabrica e fornece sistemas de tubulação isolados a vácuo para uma variedade de gases liquefeitos, como nitrogênio, oxigênio, dióxido de carbono e outros gases industriais. O seu segmento de Imaging & Identification fornece marcação e codificação de precisão, rastreabilidade de produtos, proteção da marca e equipamento de impressão digital têxtil. Seu segmento de Bombas e Soluções de Processos fabrica bombas especiais e medidores de vazão, conetores de transferência de fluidos, componentes de precisão projetados, instrumentos e controles digitais. Seu segmento de Tecnologias Climate & Sustainabili', 'Downers Grove, IL, United States', 24000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AVXL', 'STOCK', 'Anavex Life Sciences Corp.', 'NMS', 'Healthcare', 'Biotechnology', 'Anavex Life Sciences Corp. is a clinical-stage biopharmaceutical company engaged in the development of differentiated therapeutics by applying precision medicine to central nervous system (CNS) diseases with high unmet need. The Company analyzes genomic data from clinical trials to identify biomarkers, which it uses in the analysis of its clinical trials. Its focus is on developing treatments for Alzheimers disease, Parkinsons disease, schizophrenia, neurodevelopmental, neurodegenerative, and rare diseases, including Rett syndrome, and other CNS disorders. It has two core programs and two seed programs. ANAVEX 2-73 is being developed as an oral liquid once-daily formulation for rare diseases such as Rett syndrome as well as an oral once-daily capsule formulation for diseases such as Alzheimers disease. ANAVEX 3-71 is a CNS-penetrable potential disease-modifying treatment for cognitive impairments. Its other candidates include ANAVEX 1-41, ANAVEX 1066 and ANAVEX 1037.', 'New York, NY, United States', 42);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACHV', 'STOCK', 'Achieve Life Sciences, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Achieve Life Sciences, Inc. is a late-stage specialty pharmaceutical company. The Company focuses on addressing the global smoking health and nicotine dependence epidemic through the development and commercialization of cytisinicline. It has completed two Phase III studies with cytisinicline for smoking cessation and one Phase II study with cytisinicline in vaping cessation. Cytisinicline is a naturally occurring, plant-based alkaloid. Cytisinicline is structurally similar to nicotine and has a dual-acting mechanism of action, being both a receptor agonist and antagonist. Cytisinicline is an investigational product candidate being developed for the treatment of nicotine dependence and has not been approved by the Food and Drug Administration for any indication in the United States. Cytisinicline acts as a partial agonist/antagonist, binding to alpha-4 beta-2 nicotinic receptors in the brain and is thought to have two potential consequences in treating nicotine dependence.', 'Bothell, WA, United States', 25);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BNZI', 'STOCK', 'Banzai International, Inc.', 'NCM', 'Technology', 'Software - Application', 'Banzai International, Inc. is a marketing technology company that provides artificial intelligence (AI)-enabled marketing and sales solutions for businesses of all sizes. The Company enables companies of all sizes to target, engage, and measure both new and existing customers more effectively. Its platform offers three software as a service (SaaS) products: Demio, Boost, and Reach. Demio is a user-friendly, browser-based webinar platform with extensive data and marketing features designed to help businesses engage with their audience through live events and on-demand, interactive video content. Boost is a tool utilized by customers to enhance participation in their Demio webinars. This tool allows registered attendees to promote Demio webinars on social media platforms. Customers use Reach to directly connect with their events target audience to increase registrations for their events. It also provides video hosting and marketing suite solutions for businesses through Vidello.', 'Bainbridge Island, WA, United States', 28);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FLGC', 'STOCK', 'Flora Growth Corp.', 'NCM', 'Healthcare', 'Drug Manufacturers - Specialty & Generic', 'Flora Growth Corp. is a cannabis company that manufactures and distributes consumer packaged goods and distributes medicinal cannabis and pharmaceutical products. Its brand consists of JustCBD, Vessel, Melo, Haze, and Australian Vaporizers. JustCBD is a consumer-packaged goods brand with over 350 products, including cannabidiol gummies, topicals, tinctures, and vape products. JustCBD products are available for purchase in smoke and vape shops, clinics, spas, and pet stores, as well as other independent non-traditional retail channels. Vessel is the cannabis accessory and technology brand servicing the United States and Canada through direct-to-consumer and retail sales. Vessel''s products include cannabis consumption accessories, personal storage, and travel accessories for the vape and dry herb categories, which are sold to consumers, dispensaries, smoke shops, and cannabis brands. Australian Vaporizers is an online retailer of vaporizers, hardware, and accessories in Australia.', 'Fort Lauderdale, FL, United States', 64);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CODI', 'STOCK', 'Compass Diversified', 'NYQ', 'Industrials', 'Conglomerates', 'Compass Diversified Holdings is engaged in owning and managing a diverse set of defensible, middle-market businesses across the branded consumer, industrial, healthcare, and critical outsourced services sectors. It categorizes its businesses into two separate groups: branded consumer businesses and industrial businesses. Its segments include 5.11 Acquisition Corp. (5.11), Boa Holdings Inc. (BOA), Lugano Holdings, Inc. (Lugano), Relentless Topco, Inc. (PrimaLoft), THP Topco, Inc., CBCP Products, LLC, AMTAC Holdings, LLC (Arnold), FFI Compass, Inc. (Altor Solutions or Altor) and SternoCandleLamp Holdings, Inc. (Sterno). 5.11 is a provider of purpose-built technical apparel and gear for law enforcement, firefighters, EMS, and military special operations as well as outdoor and adventure enthusiasts. BOA is a creator of the patented BOA Fit System, which consists of three integral parts: a micro-adjustable dial, high-tensile lightweight laces, and low friction lace guides.', 'Westport, CT, United States', 3340);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ANVS', 'STOCK', 'Annovis Bio, Inc.', 'NYQ', 'Healthcare', 'Biotechnology', 'Annovis Bio, Inc. is a late-stage clinical drug platform company addressing neurodegeneration such as Alzheimers disease (AD), and Parkinsons disease (PD). The Company is developing its lead product candidate, Buntanetap, which is designed to address AD, PD, and potentially other chronic neurodegenerative diseases. Buntanetap is a synthetically produced small molecule, orally administered, brain penetrant compound. Its product candidate ANVS405 is an intravenous drug being developed for acute indications and focused on protecting the brain after traumatic brain injury and/or stroke. ANVS405 is the same compound as Buntanetap, given in cases of acute head and brain trauma. ANVS301 is an orally administered drug being developed to increase cognitive capability in later stages of AD and dementia. ANVS301 is observed to improve memory and learning in very old rats by lowering the number of errors from over six to three.', 'Malvern, PA, United States', 8);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AHCO', 'STOCK', 'AdaptHealth Corp.', 'NCM', 'Healthcare', 'Medical Devices', 'AdaptHealth Corp. is a provider of patient-centered, healthcare-at-home solutions including home medical equipment (HME), medical supplies, and related services. The Company provides a full suite of medical products and solutions designed to help patients manage chronic conditions in the home. Its product and service offerings include sleep therapy equipment, supplies, and related services (including CPAP and bi PAP services) to individuals suffering from obstructive sleep apnea; medical devices and supplies to patients for the treatment of diabetes, including continuous glucose monitors and insulin pumps; HME to patients discharged from acute care and other facilities; oxygen and related chronic therapy services in the home, and other HME devices and supplies on behalf of chronically ill patients with wound care, urological, incontinence, ostomy and nutritional supply needs. It operates in 50 states through its network of over 670 locations in 47 states.', 'Plymouth Meeting, PA, United States', 10500);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AACT', 'STOCK', 'Ares Acquisition Corporation II', 'NYQ', 'Financial Services', 'Shell Companies', 'Ares Acquisition Corporation II is a blank check company. The Company is formed for the purpose of effecting a merger, share exchange, asset acquisition, share purchase, reorganization or similar business combination with one or more businesses. The Company is not limited to a particular industry or geographic region for the purposes of consummating a business combination. The Company has neither engaged in any operations nor generated any revenue.', 'New York, NY, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ARCT', 'STOCK', 'Arcturus Therapeutics Holdings Inc.', 'NGM', 'Healthcare', 'Biotechnology', 'Arcturus Therapeutics Holdings Inc. is a commercial mRNA medicines and vaccines company focused on the development of infectious disease vaccines and opportunities within liver and respiratory rare diseases. The Company with enabling technologies, including LUNAR lipid-mediated delivery, STARR mRNA technology (sa-mRNA) and mRNA drug substances along with drug product manufacturing. It has developed KOSTAIVE, a self-amplifying messenger RNA (sa-mRNA) COVID vaccine. The Companys pipeline includes RNA therapeutic candidates to potentially treat ornithine transcarbamylase (OTC) deficiency and cystic fibrosis (CF), along with its partnered mRNA vaccine programs for SARS-CoV-2 (COVID-19) and influenza. The Company''s versatile RNA therapeutics platforms can be applied to multiple types of nucleic acid medicines, including messenger RNA, small interfering RNA, circular RNA, antisense RNA, self-amplifying RNA, DNA, and gene editing therapeutics.', 'San Diego, CA, United States', 174);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CLDX', 'STOCK', 'Celldex Therapeutics, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Celldex Therapeutics, Inc. is a clinical-stage biotechnology company. The Company is focused on exploring the science of mast cell biology and the development of transformative therapeutics for patients. Its pipeline includes antibody-based therapeutics which have the ability to engage the human immune system and/or directly affect critical pathways to improve the lives of patients with severe inflammatory, allergic, autoimmune and other devastating diseases. Its drug candidates include monoclonal and bispecific antibodies designed to address mast cell mediated diseases. Its Barzolvolimab (CDX-0159) is a monoclonal antibody that specifically binds the KIT receptor and potently inhibits its activity, which is being studied across multiple mast cell driven diseases, including Chronic Urticarias, Prurigo Nodularis, Atopic Dermatitis and Eosinophilic Esophagitis. The Companys bispecific platform includes CDX- 622. The CDX- 622 is a bispecific candidate for inflammatory diseases.', 'Hampton, NJ, United States', 186);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CR', 'STOCK', 'Crane Company', 'NYQ', 'Industrials', 'Specialty Industrial Machinery', 'Crane Company is an industrial manufacturing and technology company. The Company is a manufacturer of engineered components for mission-critical applications focused on the aerospace, defense, space and process flow industry end markets. Its segments include Aerospace & Electronics, and Process Flow Technologies. The Aerospace & Electronics segment supplies critical components and systems, including original equipment and aftermarket parts, primarily for the commercial aerospace, and the military aerospace, defense and space markets. The Process Flow Technologies segment is a provider of engineered fluid handling equipment for critical applications. The segment is comprised of Process Valves and Related Products, Pumps and Systems and Commercial Valves. The Company also designs and manufacturers multi-stage lubrication pumps and lubrication system components technology for critical aerospace and defense applications.', 'Stamford, CT, United States', 7500);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BTCM', 'STOCK', 'BIT Mining Limited', 'NYQ', 'Technology', 'Information Technology Services', 'BIT Mining Ltd is a company principally engaged in cryptocurrency mining operation business. The Company mainly operates cryptocurrency mining machines for the sole purpose of mining cryptocurrencies (primarily bitcoin, and to a lesser extent ether).', 'Akron, OH, United States', 56);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EWZS', 'STOCK', 'iShares MSCI Brazil Small-Cap ETF', 'NGM', NULL, NULL, 'The fund generally will invest at least 80% of its assets in the component securities of the underlying index and in investments that have economic characteristics that are substantially identical to the component securities of the underlying index. The index is a free float-adjusted market capitalization-weighted index designed to measure primarily the performance of equity securities of small capitalization companies listed on stock exchanges in Brazil.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FHI', 'STOCK', 'Federated Hermes, Inc.', 'NYQ', 'Financial Services', 'Asset Management', 'Federated Hermes, Inc. is an investment management company. The Company operates through a single segment, being the investment management business. It sponsors, markets, and provides investment-related services to various investment products, including sponsored investment companies and other funds (Federated Hermes Funds); and Separate Accounts, which include separately managed accounts (SMAs), institutional accounts, sub-advised funds and other managed products in both domestic and international markets. In addition, it markets and provides stewardship and real estate development services to various domestic and international companies. The Company provides investment advisory services to approximately 176 Federated Hermes Funds. It markets these funds to institutional customers and banks, broker/dealers and other financial intermediaries who use them to meet the needs of customers and/or clients, including, among others, retail investors, corporations, and retirement plans.', 'Pittsburgh, PA, United States', 2072);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DRI', 'STOCK', 'Darden Restaurants, Inc.', 'NYQ', 'Consumer Cyclical', 'Restaurants', 'A Darden Restaurants, Inc. É uma empresa de restaurantes. A empresa possui e opera restaurantes de serviço completo nos Estados Unidos e Canadá sob os nomes comerciais Olive Garden, Longhorn Steakhouse, Yard House, Ruth''s Chris Steak House, Cheddar''s Scratch Kitchen, The Capital Grille, Chuy''s, Seasons 52, Eddie V''s e Bahama Breeze. Possui e opera aproximadamente 2 140 restaurantes nos Estados Unidos e no Canadá. Seus segmentos incluem Olive Garden, Longhorn Steakhouse, Fine Dining e outros negócios. O Olive Garden é um operador de restaurantes italianos de serviço completo nos Estados Unidos. O Longhorn Steakhouse é um restaurante especializado em carne bovina com serviço completo, que oferece uma variedade de itens de menu, incluindo carnes exclusivas e frango, bem como salmão, camarão e hambúrgueres. O Fine Dining inclui Chris de Ruth, o Capital Grille e Eddie V. Outros negócios incluem Cheddar''s Scratch Kitchen, Yard House, Bahama Breeze, Seasons 52 e The Capital Burger.', 'Orlando, FL, United States', 197924);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ANGI', 'STOCK', 'Angi Inc.', 'NMS', 'Communication Services', 'Internet Content & Information', 'Angi Inc. connects home service professionals with consumers across approximately 500 different categories, from repairing and remodeling homes to cleaning and landscaping. The Companys segments include Ads and Leads, Services, Roofing, and International (includes Europe and Canada), and operates under multiple brands including Angi, HomeAdvisor, and Handy. Ads and Leads segment provides service professionals the capability to engage with potential customers, including quoting and invoicing services, and provides consumers with tools and resources to help them find local, pre-screened and customer-rated service professionals nationwide for home repair. Services segment provides a pre-priced offering service, pursuant to which consumers can request services through Angi and Handy branded platforms. Roofing segment provides roof replacement and repair services, primarily in Florida. International segment operates international businesses, such as Travaux, MyHammer and Werkspot.', 'Denver, CO, United States', 2800);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DMAC', 'STOCK', 'DiaMedica Therapeutics Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'DiaMedica Therapeutics Inc. is a clinical-stage biopharmaceutical company focused on improving the lives of people suffering from preeclampsia (PE) and acute ischemic stroke (AIS). The Companys lead candidate, DM199, is the first pharmaceutically active recombinant (synthetic) form of the KLK1 protein, an established therapeutic modality in Asia for the treatment of pre-eclampsia, acute ischemic stroke and other vascular diseases. DM199 (rinvecalinase alfa) is a recombinant form of human tissue kallikrein-1 (rhKLK1) in clinical development for preeclampsia and acute ischemic stroke. KLK1 is a serine protease enzyme that is involved in the regulation of diverse physiological processes via a molecular mechanism that increases the production of nitric oxide, prostacyclin and endothelium-derived hyperpolarizing factors. In the treatment of preeclampsia, DM199 is intended to lower blood pressure, enhance endothelial health and improve perfusion to maternal organs and the placenta.', 'Minneapolis, MN, United States', 27);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ARHS', 'STOCK', 'Arhaus, Inc.', 'NMS', 'Consumer Cyclical', 'Specialty Retail', 'Arhaus, Inc. is a lifestyle brand and omni-channel retailer of premium home furnishings. The Company through its proprietary model, designs and sources products from manufacturers and artisans around the world. It has approximately 100 showrooms and design center locations across the United States. It offers merchandise in various categories, including furniture, outdoor, lighting, textiles, and decor. Its furniture product offerings consist of bedroom, dining room, living room and home office furnishings and include sofas, dining tables, and chairs, among others. Its outdoor product offerings include outdoor dining tables, chairs, chaises and other furniture, lighting, and others. Its lighting product offerings consist of a variety of distinct and artistic lighting fixtures. Its textile product offerings include handcrafted indoor and outdoor rugs, bed linens, and pillows and throws. Decor ranges from wall art to mirrors, vases to candles, and many other decorative accessories.', 'Boston Heights, OH, United States', 2390);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BOOT', 'STOCK', 'Boot Barn Holdings, Inc.', 'NYQ', 'Consumer Cyclical', 'Apparel Retail', 'Boot Barn Holdings, Inc. is a lifestyle retailer of western and work-related footwear, apparel, and accessories in the United States. The Company operates through two segments: retail stores and e-commerce. The retail segment is a specialty retail store that sells western and work boots and related apparel and accessories. Its e-commerce segment sells its merchandise via the Internet. The Company carries an assortment of denim, western shirts, cowboy hats, belts and belt buckles, western-style jewelry, and accessories. The western assortment includes various brands, such as Ariat, Cinch, Cody James, Corral, Dan Post, Durango, El Dorado, Idyllwind, Justin, Laredo, Lucchese, Miss Me, Montana Silversmiths, Moonshine Spirit, Shyanne, Stetson, Tony Lama, Twisted X, Resistol and Wrangler. The work assortment includes rugged footwear, outerwear, overalls, denim, and shirts. Its other brand includes Dickies, Carhartt, Wolverine, and Hawx. It operates approximately 403 stores in 45 states.', 'Irvine, CA, United States', 3300);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CNR', 'STOCK', 'Core Natural Resources, Inc.', 'NYQ', 'Energy', 'Thermal Coal', 'Core Natural Resources, Inc., formerly CONSOL Energy Inc., is a producer and exporter of coals, including metallurgical and high calorific value thermal coals. The Company operates a portfolio, including the Pennsylvania Mining Complex, Leer, Leer South, and West Elk mines. It owns and oversees 11 major coal mining operations across the country, including the longwall coal mining complexes in North America. Its mining operations also include the metallurgical coal portfolios in the United States. It has ownership interests in two marine export terminals. Its product portfolio encompasses Low-Vol, High-Vol A, High Vol-B, Crossover, High Calorific Value Thermal, and PRB coals. Through ownership of two strategic export terminals on the United States Eastern Seaboard, it is an exporter of coal products serving multiple emerging seaborne markets. It mines and markets a broad assortment of carbon-based products for industrial metallurgical applications, primarily steel production.', 'Canonsburg, PA, United States', 2076);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DGX', 'STOCK', 'Quest Diagnostics Incorporated', 'NYQ', 'Healthcare', 'Diagnostics & Research', 'O Quest Diagnostics Incorporated é um fornecedor de serviços de informação de diagnóstico. A empresa fornece informações diagnósticas dos resultados de seus testes laboratoriais para permitir que pessoas, médicos e organizações tomem medidas para melhorar os resultados de saúde. Atua através do segmento DIS, que fornece serviços de informação diagnóstica a uma variedade de clientes dentro de seus principais canais de clientes: Médicos, hospitais, pacientes e consumidores. Oferece amplo acesso a testes clínicos através de uma rede nacional de laboratórios, centros de atendimento ao paciente, flebotomistas em consultórios médicos e recursos de conetividade, incluindo call centers e flebotomistas móveis, enfermeiros e outros profissionais de saúde e bem-estar. Também se concentra em soluções de inteligência artificial (IA) e patologia digital. Os serviços da Empresa são principalmente fornecidos sob a marca Quest Diagnostics e sob outras marcas, incluindo AmeriPath, Dermpath Diagnostics, ', 'Secaucus, NJ, United States', 55000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AL', 'STOCK', 'Air Lease Corporation', 'NYQ', 'Industrials', 'Rental & Leasing Services', 'Air Lease Corporation is a global aircraft leasing company. The Company is principally engaged in purchasing new commercial aircraft and leasing them to its airline customers worldwide through customized aircraft leasing and financing solutions. It purchases commercial aircraft directly from aircraft manufacturers, such as Airbus S.A.S. (Airbus) and The Boeing Company (Boeing). In addition to its leasing activities, it sells aircraft from its fleet to third parties, including other leasing companies, financial service companies, airlines and other investors. It also provides fleet management services to investors and owners of aircraft portfolios for a management fee. It has relationships with over 200 airlines across 70 countries. The Company operates its business on a global basis, providing aircraft to airline customers in every major geographical region, including markets, such as Asia Pacific, Europe, the Middle East and Africa, Central America, South America, and others.', 'Los Angeles, CA, United States', 165);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALEC', 'STOCK', 'Alector, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Alector, Inc. is a clinical-stage biotechnology company. The Company is focused on developing therapies to counteract the devastating progression of neurodegenerative diseases. It also develops alector brain carrier (ABC), a proprietary blood-brain barrier platform, which is applied to its next-generation product candidates and research pipeline. Its research and drug discovery platform leverages human genetic datasets, advanced tools in bioinformatics and imaging, and insights in neurodegeneration. Its clinical development portfolio includes latozinemab (AL001) and AL101/GSK4527226, while its preclinical and research pipeline candidates include ADP037-ABC, ADP050-ABC, ADP056, and ADP063-ABC/ADP064-ABC. Its first product candidate, latozinemab, is a human recombinant monoclonal antibody that increases the levels of progranulin (PGRN) in the brains of FTD-GRN patients. The AL101/GSK4527226, is a human recombinant monoclonal antibody designed to elevate PGRN levels in the brain.', 'South San Francisco, CA, United States', 163);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FAF', 'STOCK', 'First American Financial Corporation', 'NYQ', 'Financial Services', 'Insurance - Specialty', 'First American Financial Corporation, through its subsidiaries, is engaged in the business of providing title insurance, settlement services and other financial services and risk solutions. Its segments include Title Insurance and Services, Home Warranty, and Corporate segment. The Title Insurance and Services segment issues title insurance policies on residential and commercial property in the United States and offers similar or related products and services internationally. This segment also provides closing and/or escrow services, accommodates tax-deferred exchanges of real estate, and maintains, manages and provides access to title plant data and records. The Home Warranty segment provides residential service contracts that cover residential systems, such as heating and air conditioning systems, and certain appliances against failures that occur as the result of normal usage during the coverage period. The Corporate segment includes investments in venture-stage companies.', 'Santa Ana, CA, United States', 19038);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CWEN', 'STOCK', 'Clearway Energy, Inc.', 'NYQ', 'Utilities', 'Utilities - Renewable', 'Clearway Energy, Inc. is a renewable energy company. It invests in energy infrastructure and focuses on investments in clean energy and owns sustainable and long-term contracted assets across North America. Its portfolio comprises approximately 11.8 gigawatts (GW) of gross capacity in 26 states, including approximately 9.1 GW of wind, solar and battery energy storage systems and approximately 2.8 GW of conventional dispatchable power capacity that provide critical grid reliability services. Its operating facilities include Carlsbad, El Segundo, GenConn Devon, GenConn Middletown, Marsh Landing and Walnut Creek. Its utility-scale solar projects include Agua Caliente, Alpine, Avenal, Avra Valley, Blythe, Borrego, Buckthorn Solar, CVSR, Daggett 2, Daggett 3, Desert Sunlight 250, Kansas South, and others. Its wind projects include Black Rock, Buffalo Bear, Cedro Hill, Crofton Bluffs, Cedar Creek, and others. It also operates the 137 MW Tuolumne Wind Project in Klickitat County, Washington.', 'Princeton, NJ, United States', 60);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EGY', 'STOCK', 'VAALCO Energy, Inc.', 'NYQ', 'Energy', 'Oil & Gas E&P', 'VAALCO Energy, Inc. is an independent energy company with a diverse portfolio of production, development and exploration assets across Gabon, Egypt, Cote dIvoire, Equatorial Guinea, Nigeria and Canada. It is engaged in the acquisition, exploration, development and production of crude oil, natural gas and natural gas liquids. It owns a working interest in, and is the operator of, the Etame PSC related to the Etame Marin block located offshore Gabon in West Africa. The Etame Marin block covers an area of about 46,200 gross acres. The Company owns an interest in an undeveloped block offshore Equatorial Guinea, West Africa. In Egypt, its interests are spread across two regions: the Eastern Desert and the Western Desert. In Harmattan, Canada, it owns production and working interests in Cardium light oil and Mannville liquids-rich gas assets. It also owns a working interest in the Block CI-40 and CI-705 block offshore Cote dIvoire in West Africa.', 'Houston, TX, United States', 230);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EHTH', 'STOCK', 'eHealth, Inc.', 'NMS', 'Financial Services', 'Insurance Brokers', 'eHealth, Inc. is an independent licensed insurance agency and advisor. It is a private health insurance marketplace with a technology and service platform that provides consumer engagement, education and health insurance enrollment solutions. Its segments include Medicare and Employer and Individual (E&I). The Medicare segment markets Medicare-related health insurance plans and, to a lesser extent, ancillary products such as dental and vision insurance and hospital indemnity plans, to its Medicare-eligible consumers. Its Medicare ecommerce platform can be accessed through its Websites www.eHealthMedicare.com and www.GoMedigap.com, along with its telephonic enrollment capabilities. The E&I segment markets individual and family health insurance plans, along with employer plans, which include small business health insurance plans and individual coverage health reimbursement arrangements. It also markets a variety of ancillary products, including short-term, dental and vision plans.', 'Austin, TX, United States', 1773);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DC', 'STOCK', 'Dakota Gold Corp.', 'ASE', 'Basic Materials', 'Gold', 'Dakota Gold Corp. is a gold exploration and development company with a focus on revitalizing the Homestake District in Lead, South Dakota. The Company focuses on advancing the Richmond Hill Oxide Heap Leach Gold Project and outlining a high-grade underground gold resource at the Maitland Gold Project located on private land in South Dakota. The Richmond Hill Oxide Heap Leach Gold Project is located in the western portion of Lawrence County, South Dakota, United States of America. The Maitland Property covers the Homestake iron formation extending from the Blind Gold Property target at the north end to Homestake Mining Company''s North Drift gold discovery. Its other gold projects include City Creek Gold Project, Blind Gold Project, Tinton Gold Project, Cambrian Unconformity Project, West Corridor Gold Project, Ragged Top Gold Project, and South Lead / Whistler Gulch Gold Project. The City Creek project consists of a group of 333 unpatented lode-mining claims (6,161 acres).', 'Lead, SD, United States', 41);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('VBTX', 'STOCK', 'Veritex Holdings, Inc.', 'NGM', 'Financial Services', 'Banks - Regional', 'Veritex Holdings, Inc. is a bank holding company. The Company conducts banking activities through its wholly owned subsidiary, Veritex Community Bank (the Bank), with locations throughout the Dallas-Fort Worth metroplex and in the Houston metropolitan area. The Bank provides a full range of banking services, including commercial and retail lending and checking and savings deposit products, to individual and corporate customers. It operates through the community banking segment. The Bank provides relationship-driven commercial banking products and services tailored to meet the needs of small to medium-sized businesses and professionals. The Bank offers a full suite of online banking solutions, including access to account balances, online transfers, online bill payment and electronic delivery of customer statements, as well as ATMs, and mobile and digital banking, mail and personal appointments. The Bank also offers a full array of commercial treasury management services.', 'Dallas, TX, United States', 858);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRF', 'STOCK', 'Cornerstone Total Return Fund, Inc.', 'ASE', 'Financial Services', 'Asset Management', 'Cornerstone Total Return Fund, Inc. is a closed-ended equity mutual fund launched and managed by Cornerstone Advisors, LLC. It invests in the public equity markets of the United States. The fund seeks to invest in stocks of companies operating across diversified sectors. It primarily invests in value and growth stocks of companies across all market capitalizations. The fund also invests through other closed-end investment companies and ETFs. It benchmarks the performance of its portfolio against the S&P 500 Index. Cornerstone Total Return Fund, Inc. was formed on March 16, 1973 and is domiciled in the United States.', 'Asheville, NC, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FTGC', 'STOCK', 'First Trust Global Tactical Commodity Strategy Fund', 'NGM', NULL, NULL, 'The fund is an actively managed exchange-traded fund ("ETF") that seeks to achieve attractive risk adjusted returns by investing in commodity futures contracts, exchange-traded commodity linked instruments, and commodity linked total return swaps (collectively, "Commodities Instruments") through a wholly-owned subsidiary of the fund organized under the laws of the Cayman Islands (the "Subsidiary"). The advisor expects to gain exposure to these investments exclusively by investing in the Subsidiary.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('TARS', 'STOCK', 'Tarsus Pharmaceuticals, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Tarsus Pharmaceuticals, Inc. is a commercial-stage biopharmaceutical company. The Company is focused on the development and commercialization of therapeutics, starting with eye care. The Companys lead product candidate, XDEMVY, is a lotilaner ophthalmic solution that targets and eradicates the root cause of Demodex blepharitis, Demodex mite infestation. The active pharmaceutical ingredient (API) of XDEMVY, lotilaner, paralyzes and eradicates mites and other parasites through the inhibition of parasite-specific gamma-aminobutyric acid-gated chloride channels. The Company is investigating the development of its product candidates to address targeted diseases with high unmet medical needs, which include TP-04, a novel ophthalmic gel formulation of lotilaner for the potential treatment of Ocular Rosacea, and TP-05, a novel investigational oral formulation of lotilaner, for potential Lyme disease prophylaxis and community malaria reduction.', 'Irvine, CA, United States', 323);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('UPLD', 'STOCK', 'Upland Software, Inc.', 'NGM', 'Technology', 'Software - Application', 'Upland Software, Inc. provides artificial intelligence (AI)-powered knowledge and content management software. The Company provides cloud-based software applications. Its solutions cover knowledge management, content lifecycle and workflow automation, and digital marketing. It provides knowledge management solutions designed to help organizations capture, organize, and distribute information to employees and customers. It also offers content lifecycle and workflow automation solutions that support document management, compliance, and process efficiency across various industries. Digital marketing solutions provide tools for audience engagement, campaign management, and content distribution across digital channels. The Companys customers operate in a range of industries, including financial services, consulting services, technology, manufacturing, media, telecommunications, government, insurance, non-profit, healthcare, life sciences, legal, retail and hospitality.', 'Austin, TX, United States', 998);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CNDT', 'STOCK', 'Conduent Incorporated', 'NMS', 'Technology', 'Information Technology Services', 'Conduent Incorporated is a global technology-led business process solutions and services company. The Companys Commercial segment provides business process services that span its clients business processes end-to-end from the front-office to the back-office for a variety of commercial industries. Its technology-led solutions and services include Customer Experience Management (CXM), Business Operations Solutions (BOS), Healthcare Claims and Administration Solutions and Human Capital Solutions (HCS). Its Government segment provides government-centric services and solutions to U.S. federal, state, local and foreign governments for public assistance, healthcare programs and administration, transaction processing, payment services and case management. Its Transportation segment provides systems, support and revenue-generating solutions to government transportation agency clients. It delivers mission-critical tolling, transit and digital payment solutions that streamline operations.', 'Florham Park, NJ, United States', 53000);\n
